// Dashboard.jsx
import { useState, useEffect } from "react";
import { useLocation } from "react-router-dom";
import "./Dashboard.css"; // tu CSS rÃ­gido

export default function Dashboard() {
  const [residente, setResidente] = useState({
    rut: "",
    nombre: "Pendiente de BD",
    proximoControl: "........",
    medico: "........",
    diagnostico: "........",
    medicamento: "........",
    dosis: "........",
    casoSOS: "........"
  });

  const location = useLocation();

  useEffect(() => {
    const params = new URLSearchParams(location.search);
    const rutQuery = params.get("rut");
    if (rutQuery) setResidente(prev => ({ ...prev, rut: rutQuery }));
  }, [location]);

  return (
    <div className="dashboard">
      {/* Banner */}
      <header className="banner">
        <div className="logo-container">
          <div className="logo"></div>
          <h1 className="logo-text">Red ELEAM</h1>
        </div>
      </header>

      {/* TÃ­tulo */}
      <h2 className="portal-title">Portal de Medicamentos ELEAM</h2>

      {/* Datos del residente */}
      <div className="datos-residente">
        <div className="residente-image"></div>
        <div className="residente-info">
          <p><b>Nombre residente:</b> {residente.nombre}</p>
          <p><b>RUN:</b> {residente.rut}</p>
          <p><b>PrÃ³ximo control:</b> {residente.proximoControl}</p>
          <p><b>MÃ©dico tratante:</b> {residente.medico}</p>
        </div>
      </div>

      {/* Botones de acciÃ³n */}
      <div className="botones-dashboard">
        <button className="boton1">ð Ver Ficha ClÃ­nica</button>
        <button className="boton2">â¹ï¸ InformaciÃ³n Control Anterior</button>
        <button className="boton3">ð InformaciÃ³n Medicamentos</button>
        <button className="boton4">ðª Salir</button>
      </div>

      {/* DiagnÃ³stico */}
      <div className="diagnostico">
        <h3>DiagnÃ³stico Residente</h3>
        <div className="diagnostico-info">
          <div>
            <p><b>DiagnÃ³stico:</b> {residente.diagnostico}</p>
            <p><b>MÃ©dico que indica:</b> {residente.medico}</p>
          </div>
          <div>
            <p><b>Nombre Medicamento (Compuesto):</b> {residente.medicamento}</p>
            <p><b>Dosis:</b> {residente.dosis}</p>
            <p><b>Caso SOS:</b> {residente.casoSOS}</p>
          </div>
        </div>
      </div>
    </div>
  );
}
